import React from "react";
import IMovieTheatre from '../../models/IMovieTheatre';
import Card from 'react-bootstrap/Card';


type Props = {
    movie:  IMovieTheatre
}
const MoveieListItem = ({ movie }: Props) => {
    const {
        id,
        title  ,
        year ,
        genres ,
        ratings ,
        poster ,
        contentRating  ,
        duration,
        releaseDate  ,
        averageRating ,
        originalTitle ,
        storyline  ,
        actors ,
        imdbRating ,
        posterurl 
    } = movie;
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Img variant="top" src={`${process.env.REACT_APP_API_BASE_URL}${posterurl}`} />
            <Card.Body>
                <Card.Title>{title}</Card.Title>
             {/* <Card.Text>{storyline}</Card.Text> */}
            </Card.Body>
        </Card>
    );
}

export default MoveieListItem;
